    height: 50,
    paddingLeft: 10,
    paddingRight: 10,
    justifyContent: 'flex-start',
    alignItems: 'center'
  },
  buttons: {
    marginTop: 10,
  },
  menues: {
    width: 100,
    color: 'white',
    fontSize: 14,
    fontWeight: "500",
